import React from "react";
import { Nav } from "react-bootstrap";

const SecondaryNavItem = ({ data }) => {
  return (
    <Nav.Item>
      <Nav.Link href="#">
        {data.color ? 
          <span style={{"color": data.color}}>{data.title}</span>
        : data.title}
      </Nav.Link>
    </Nav.Item>
  )
}


export default SecondaryNavItem
